const Card = (props) =>  {


  return (
      <div className="Card">
          <Link to={'edit/'+ props.id}><img className="moreButton" alt="edit button" src={more} /></Link>
          <h2 className="name">{props.name}</h2>
          <h3 className="speed">{props.speed +" mph"}</h3>
          <p className="color">{props.color}</p>
      </div>
  );
};

export default Card;
